pattern = re.compile('|'.join(unaccentify))
def unaccentify_text(text):
    def replacer(match):
        return unaccentify[match.group(0)]

    source = unicodedata.normalize('NFKC', text)
    return pattern.sub(replacer, source)


def get_lemmatized_words(text):
    words = EXTRACT_WORDS_REGEX.findall(text)
    lemmatized_words = list(filter(None, map(lambda word: nlp_base.lemmatize_word(word)[1], words)))
    return lemmatized_words


