with open(file='result-json-one-file_only-articles/AA/wiki_00', mode='r', encoding='utf-8') as fp:
    with open(file=output_file, mode='w', encoding='utf-8') as resfp:
        for line in fp:
            cur_json = ujson.loads(line)

            if cur_json['id'] in article_texts_without_titles:
                text_not_found_count += 1
                continue

            formatted_text = unaccentify_text(html.unescape(cur_json['text'])).replace('­', '')

            if len(formatted_text) >= 200 and not USELESS_TEXT_REGEX.match(formatted_text):
                if is_logged:
                    is_logged = False

                formatted_title = unaccentify_text(html.unescape(cur_json['title'])).replace('­', '')

                title_with_brackets = TITLE_WITH_BRACKETS_REGEX.match(formatted_title)
                if title_with_brackets is not None:
                    formatted_title = title_with_brackets.group(0)

                cur_json['title'] = formatted_title
                cur_json['text'] = formatted_text
                cur_json['lemmatized_title'] = get_lemmatized_words(formatted_title)
                cur_json['lemmatized_words_counter'] = collections.Counter(get_lemmatized_words(formatted_text))

                del cur_json['revid']
                del cur_json['url']

                count += 1
                resfp.write(ujson.dumps(cur_json))
                resfp.write('\n')
            else:
                # print(f"TEXT NOT FOUND - {cur_json['title']}")
                # print(cur_json)
                text_not_found_count += 1

            if not is_logged and count % 10000 == 0:
                print(f"{count} штук записано")
                is_logged = True

print(f"{count} штук записано")
print(f"{text_not_found_count} штук НЕ записано")


